function sumFibs(num) {
  let fibonacciArr = [1, 1];
  let last = fibonacciArr[fibonacciArr.length - 1];
  let prev = fibonacciArr[fibonacciArr.length - 2];
  let fibonnaciSum = 0;
  if(num === 1) {
    return fibonacciArr[0];
  }
  if(num === 2) {
    return fibonacciArr[1];
  }
  // Build Fibonacci array
  while(last < num) {
    fibonacciArr.push(last + prev);
    last = fibonacciArr[fibonacciArr.length - 1];
    prev = fibonacciArr[fibonacciArr.length - 2];
  }
  // Sum odd numbers in Fibonacci array
  for(let y = 0; y < fibonacciArr.length; y++) {
    if(fibonacciArr[y] % 2 !== 0 && fibonacciArr[y] <= num) {
      fibonnaciSum += fibonacciArr[y];
    }
  }
  console.log(fibonnaciSum);
  return fibonnaciSum;
}

